    [],nt"revision_timestamp": "2016-07-27T22:22:12.153334",nt"name": "butterfly-surveys-in-north-dakota-1995",nt"isopen":
    false,nt"url": null,nt"notes": "The main goal of this study was to conduct
    inventories of butterflies and skippers on a number of prairie and wetland sites
    in North Dakota and determine the location and abundance of the Dakota Skipper (Hesperia
    dacotae), Powesheik Skipper (Oarisma powesheik), Ottoe Skipper (Hesperia ottoe),
    Regal Fritillary (Speyeria idalia), and other rare butterflies.  The sites inventoried
    included two U.S. Fish and Wildlife Service areas, Krause WPA and Stack Slough NWR;
    two sites owned by The Nature Conservancy, Pigeon Point Preserve and Sheridan Prairie
    Preserve; and four private sites, the Sagvold Tract, the Schultz Tract, Sheldon
    Seeps, and Brown Ranch.  Surveys took place from 26 June to 9 July 1995. The Dakota
    Skipper was documented at six new sites: Hartleben Prairie (Stack Slough NWR), the
    Schultz Tract, and 4 quarter sections of Brown Ranch. The Powesheik Skipper was
    found in two new sites at Hartleben Prairie, after having not been recorded anywhere
    in the state for several years. The Regal Fritillary was found only at Hartleben
    Prairie. No sightings of the Ottoe Skipper were made, although the Mulberry Wing
    (Poanes massasoit) again flew at Sheldon Seeps. This report will document the results
    of the survey, grouped by site, and detail sightings of rare species. It will also
    make preliminary recommendations on management for sites with rare species.",nt"license_title":
